import './App.module.css';
import Calendar from './components/Calendar';

function App() {

  useEffect (() => {
    document.body.style.backgroundImage = 'url(./autumn1.jpg)';
})

  return <div>
    <header>Календар - чекліст</header>
    <main>
          <Calendar />
    </main>
  </div>
}

export default App;
